create database my_train_titanic;
use my_train_titanic;

CREATE TABLE IF NOT EXISTS tickets(
  id INT(11) primary key, 
  ticket VARCHAR(100), 
  fare DECIMAL(10, 2)
);

CREATE TABLE IF NOT EXISTS ports(
  id INT(11) primary key, 
  embarked VARCHAR(1), 
  city VARCHAR(100)
);

CREATE TABLE IF NOT EXISTS passengers(
  id INT(11), 
  survived DECIMAL(10, 2), 
  pclass DECIMAL(10, 2), 
  name VARCHAR(100), 
  sex VARCHAR(6), 
  age DECIMAL(10, 2), 
  sibsp INT(11), 
  parch INT(11), 
  cabin VARCHAR(100), 
  ticketId INT(11), 
  portId INT(11),
  foreign key(ticketId) references tickets(id),
  foreign key(portId) references ports(id)
);

